import React, { Component } from 'react';
import { Redirect, Route } from 'react-router-dom';
import {isUserAuthenticated} from  '../../utils/api-utils'

import {
    Form,
    Input,
    Icon,
    notification
  } from 'antd';
import Dashboard from '../../pages/doctor/dashboardpage/dashboard'
import Drugpage from '../../pages/doctor/drugpage/drug'

class PrivateRoute extends Component  {
    constructor(props) {
        super(props);
        this.state = {
            redirectMe: {
                status:false,
                path:''
            }
           }
        this.onSubmitExperience = this.onSubmitExperience.bind(this);

    }

    componentDidMount() {
        console.log("Private Route")
        this.getAuthentication()
    }

    getAuthentication = () =>{
        if(!isUserAuthenticated()){
            this.setRoute()
        }
    }



    setRoute=(path)=>{
        this.setState({redirectMe: {
                status:true,
                path:`/${path}`
            }
        })
    }

  render() {
    if(this.state.redirectMe.status){
        console.log("Redirecting");
        return <Redirect to={this.state.redirectMe.path} />
    }

    return (
        <div>
            <Route exact path='/dashboard' component={Dashboard} />
            <Route exact path='/drug' component={Drugpage} />
        </div>
    );
  }
}

export default PrivateRoute;
